  false,\n\t\"url\": null,\n\t\"notes\": \"The National Waterway Network (NTAD 2015)
  is a comprehensive network database of the nation's navigable waterways. The data
  set covers the 48 contiguous states plus the District of Columbia, Hawaii, Alaska,
  Puerto Rico and water links between. The nominal scale of the dataset varies with
  the source material. The majority of the information is at 1:100,000 with larger
  scales used in harbor/bay/port areas and smaller scales used in open waters.\",\n\t\"license_title\":
